/*******************************************************************************************************
***    CREATE NEW TABLES + LOAD CODE/DESCRIPTION TABLES + SYSTEM WIDE ENVIRONMENT TABLES
********************************************************************************************************/
SET FOREIGN_KEY_CHECKS=0;

DROP TABLE IF EXISTS SignInFact;
CREATE TABLE `SignInFact` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `userId` int(11) NOT NULL,
  `impersonatedUserId` int(11) DEFAULT NULL,
  `startDate` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `endDate` timestamp NULL DEFAULT NULL,
  `sessionId` varchar(255) NOT NULL,
  `ipAddress` varchar(255) DEFAULT NULL,
  `countryCode` varchar(2) DEFAULT NULL,
  `city` varchar(255) DEFAULT NULL,
  `latitude` varchar(255) DEFAULT NULL,
  `longitude` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `FK_SignInFact_User` (`userId`),
  KEY `FK_SignInFact_ImpersonatedUser` (`impersonatedUserId`),
  KEY `IDX_SESSION_ID` (`sessionId`,`startDate`)
) ENGINE=InnoDB AUTO_INCREMENT=0 DEFAULT CHARSET=utf8;
DROP TABLE AccessRole;
CREATE TABLE AccessRole ( accessRoleId int NOT NULL AUTO_INCREMENT, description varchar(50) NOT NULL, sortOrder int DEFAULT '0' NOT NULL, companyId int NOT NULL, createdBy int NOT NULL, createDate datetime NOT NULL, lastChangedBy int NOT NULL, lastChangeDate datetime NOT NULL, version int DEFAULT '0' NOT NULL, PRIMARY KEY (accessRoleId) ) ENGINE=InnoDB DEFAULT CHARSET=utf8;
DROP TABLE ApprovalStatus;
CREATE TABLE ApprovalStatus ( approvalStatusId int NOT NULL AUTO_INCREMENT, PRIMARY KEY (approvalStatusId) ) ENGINE=InnoDB DEFAULT CHARSET=utf8;
DROP TABLE ApprovalStatusLocale;
CREATE TABLE ApprovalStatusLocale ( approvalStatusId int NOT NULL AUTO_INCREMENT, description varchar(50) NOT NULL, sortOrder int NOT NULL, localeCode varchar(10) DEFAULT 'en_US' NOT NULL, PRIMARY KEY (approvalStatusId, localeCode) ) ENGINE=InnoDB DEFAULT CHARSET=utf8;
DROP TABLE Attachment;
CREATE TABLE Attachment ( attachmentId int NOT NULL COMMENT 'Sequential ID.', fileName varchar(50) NOT NULL COMMENT 'Name of the file.', fileType varchar(45) NOT NULL COMMENT 'File extension.', fileSizeInMB int NOT NULL COMMENT 'File size.', storageURL varchar(255) COMMENT 'Optional stoprage URL.', entityId varchar(45) COMMENT 'ProductId, TestCaseId, TestRunId', entityTypeId int NOT NULL COMMENT 'Product, TestCase, TestRun, etc.', createdBy int NOT NULL, createDate datetime NOT NULL, PRIMARY KEY (attachmentId) ) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='environment rules required to execute the Test Case.';
DROP TABLE AttachmentTestCaseVersion;
CREATE TABLE AttachmentTestCaseVersion ( attachmentTestCaseVersionId int NOT NULL AUTO_INCREMENT, attachmentId int NOT NULL, testCaseVersionId int NOT NULL, PRIMARY KEY (attachmentTestCaseVersionId) ) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Associates attachment to specific versions of test case.';
DROP TABLE Company;
CREATE TABLE Company ( companyId int NOT NULL AUTO_INCREMENT, name varchar(50) NOT NULL, phone varchar(50), address varchar(50), city varchar(50), zip varchar(50), url varchar(100), countryId int(50), createdBy int NOT NULL, createDate datetime NOT NULL, lastChangedBy int NOT NULL, lastChangeDate datetime NOT NULL, version int DEFAULT '0' NOT NULL, PRIMARY KEY (companyId) ) ENGINE=InnoDB DEFAULT CHARSET=utf8;
DROP TABLE EntityType;
CREATE TABLE EntityType ( entityTypeId int NOT NULL COMMENT 'Sequential ID.', entityCode char(3) NOT NULL, description text NOT NULL COMMENT 'Describes type of the entity, i.e. Test Case, Test Run.', PRIMARY KEY (entityTypeId) ) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Describes type of the entity, i.e. Test Case, Test Run.';
DROP TABLE Environment;
CREATE TABLE Environment ( environmentId int NOT NULL AUTO_INCREMENT COMMENT 'Sequential ID.', environmentTypeId int NOT NULL COMMENT 'Country, Language, etc.', companyId int DEFAULT '-22222' NOT NULL, createdBy int NOT NULL, createDate datetime NOT NULL, lastChangedBy int NOT NULL, lastChangeDate datetime NOT NULL, version int DEFAULT '0' NOT NULL, originalId int NOT NULL, PRIMARY KEY (environmentId) ) ENGINE=InnoDB DEFAULT CHARSET=utf8;
DROP TABLE EnvironmentGroup;
CREATE TABLE EnvironmentGroup ( environmentGroupId int NOT NULL AUTO_INCREMENT, name varchar(255) NOT NULL, description text, createdBy int NOT NULL, createDate datetime NOT NULL, lastChangedBy int NOT NULL, lastChangeDate datetime NOT NULL, deprecated tinyint(1) DEFAULT '0' NOT NULL, executed tinyint(1) DEFAULT '0' NOT NULL, companyId int NOT NULL, version int DEFAULT '0' NOT NULL, PRIMARY KEY (environmentGroupId) ) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Definition of a set of environmental requirements. ';
DROP TABLE EnvironmentGroupEnvironment;
CREATE TABLE EnvironmentGroupEnvironment ( environmentGroupEnvironmentId int NOT NULL AUTO_INCREMENT, environmentGroupId int NOT NULL, environmentId int NOT NULL, optional tinyint(1) NOT NULL, weightIndex int NOT NULL, createdBy int NOT NULL, createDate datetime NOT NULL, lastChangedBy int NOT NULL, lastChangeDate datetime NOT NULL, version int DEFAULT '0' NOT NULL, PRIMARY KEY (environmentGroupEnvironmentId) ) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Definition environmental requirement in a related set. ';
DROP TABLE EnvironmentLocale;
CREATE TABLE EnvironmentLocale ( environmentLocaleId int NOT NULL AUTO_INCREMENT COMMENT 'Sequential ID.', environmentId int NOT NULL, description text NOT NULL, localeCode char(5) DEFAULT 'en_US' NOT NULL COMMENT 'en_US, ru_RU, etc.', sortOrder int DEFAULT '0' NOT NULL, createdBy int NOT NULL, createDate datetime NOT NULL, lastChangedBy int NOT NULL, lastChangeDate datetime NOT NULL, PRIMARY KEY (environmentLocaleId) ) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Localized descriptions';
DROP TABLE EnvironmentProfile;
CREATE TABLE EnvironmentProfile ( environmentProfileId int NOT NULL AUTO_INCREMENT, name varchar(255) NOT NULL, description text, createdBy int NOT NULL, createDate datetime NOT NULL, lastChangedBy int NOT NULL, lastChangeDate datetime NOT NULL, companyId int DEFAULT '-22222' NOT NULL, version int DEFAULT '0' NOT NULL, PRIMARY KEY (environmentProfileId) ) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Definition of a set of environmental requirements. ';
DROP TABLE EnvironmentProfileEnvironment;
CREATE TABLE EnvironmentProfileEnvironment ( environmentProfileEnvironmentId int NOT NULL AUTO_INCREMENT, environmentProfileId int NOT NULL, environmentId int NOT NULL, optional tinyint(1) NOT NULL, weightIndex int NOT NULL, createdBy int NOT NULL, createDate datetime NOT NULL, lastChangedBy int NOT NULL, lastChangeDate datetime NOT NULL, version int DEFAULT '0' NOT NULL, PRIMARY KEY (environmentProfileEnvironmentId) ) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Definition environmental requirement in a related set. ';
DROP TABLE EnvironmentProfileEnvironmentGroup;
CREATE TABLE EnvironmentProfileEnvironmentGroup ( environmentProfileEnvironmentGroupId int NOT NULL AUTO_INCREMENT, environmentGroupId int NOT NULL, environmentProfileId int NOT NULL, createdBy int NOT NULL, createDate datetime NOT NULL, lastChangedBy int NOT NULL, lastChangeDate datetime NOT NULL, PRIMARY KEY (environmentProfileEnvironmentGroupId) ) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Each group within profile = separate test result.';
DROP TABLE EnvironmentType;
CREATE TABLE EnvironmentType ( environmentTypeId int NOT NULL AUTO_INCREMENT COMMENT 'Sequential ID.', parentEnvironmentTypeId int COMMENT 'States within USA.', companyId int DEFAULT '-22222' NOT NULL, createdBy int NOT NULL, createDate datetime NOT NULL, lastChangedBy int NOT NULL, lastChangeDate datetime NOT NULL, version int DEFAULT '0' NOT NULL, PRIMARY KEY (environmentTypeId) ) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Could be anything like Country, Language, etc.';
DROP TABLE EnvironmentTypeLocale;
CREATE TABLE EnvironmentTypeLocale ( environmentTypeLocaleId int NOT NULL AUTO_INCREMENT COMMENT 'Sequential ID.', environmentTypeId int NOT NULL, description text NOT NULL, localeCode char(5) NOT NULL COMMENT 'en_US, ru_RU, etc.', sortOrder int NOT NULL, createdBy int NOT NULL, createDate datetime NOT NULL, lastChangedBy int NOT NULL, lastChangeDate datetime NOT NULL, PRIMARY KEY (environmentTypeLocaleId) ) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Localized descriptions';
DROP TABLE ParentDependableEnvironment;
CREATE TABLE ParentDependableEnvironment ( parentDependableEnvironmentId int NOT NULL AUTO_INCREMENT COMMENT 'Sequential ID.', environmentId int NOT NULL COMMENT 'like Model ID', parentEnvironmentId int NOT NULL COMMENT 'Like Make ID', companyId int DEFAULT '-22222' NOT NULL, createdBy int NOT NULL, createDate datetime NOT NULL, lastChangedBy int NOT NULL, lastChangeDate datetime NOT NULL, PRIMARY KEY (parentDependableEnvironmentId) ) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='dependencies between parent/child, like Make and Model.';
DROP TABLE Permission;
CREATE TABLE Permission ( permissionId int NOT NULL AUTO_INCREMENT, permissionCode varchar(50) NOT NULL, description varchar(250) NOT NULL, assignable tinyint(1) DEFAULT '1' NOT NULL, PRIMARY KEY (permissionId) ) ENGINE=InnoDB DEFAULT CHARSET=utf8;
DROP TABLE Product;
CREATE TABLE Product ( productId int NOT NULL AUTO_INCREMENT, name varchar(255) NOT NULL COMMENT 'Name of the product.', description text COMMENT 'Detailed description of the Product.', companyId int NOT NULL, environmentProfileId int, createdBy int NOT NULL, createDate datetime NOT NULL, lastChangedBy int NOT NULL, lastChangeDate datetime NOT NULL, version int DEFAULT '0' NOT NULL, PRIMARY KEY (productId) ) ENGINE=InnoDB DEFAULT CHARSET=utf8;
DROP TABLE ProductComponent;
CREATE TABLE ProductComponent ( productComponentId int NOT NULL AUTO_INCREMENT, productId int NOT NULL, name varchar(255) NOT NULL COMMENT 'Name of Component.', description text COMMENT 'Detailed description of Component', createdBy int NOT NULL, createDate datetime NOT NULL, lastChangedBy int NOT NULL, lastChangeDate datetime NOT NULL, version int DEFAULT '0' NOT NULL, PRIMARY KEY (productComponentId) ) ENGINE=InnoDB DEFAULT CHARSET=utf8;
DROP TABLE RolePermission;
CREATE TABLE RolePermission ( rolePermissionId int NOT NULL AUTO_INCREMENT, permissionId int NOT NULL, accessRoleId int NOT NULL, createdBy int NOT NULL, createDate datetime NOT NULL, lastChangedBy int NOT NULL, lastChangeDate datetime NOT NULL, PRIMARY KEY (rolePermissionId) ) ENGINE=InnoDB DEFAULT CHARSET=utf8;
DROP TABLE TestCase;
CREATE TABLE TestCase ( testCaseId int NOT NULL AUTO_INCREMENT, productId int NOT NULL, maxAttachmentSizeInMBytes int DEFAULT '10' NOT NULL, maxNumberOfAttachments int DEFAULT '3' NOT NULL, testCycleId int COMMENT 'Indicates if during specific Test Cycle.', PRIMARY KEY (testCaseId) ) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Test Cases defined for a specific Product.';
DROP TABLE TestCaseProductComponent;
CREATE TABLE TestCaseProductComponent ( testCaseProductComponentId int NOT NULL AUTO_INCREMENT, testCaseId int NOT NULL COMMENT 'Associated test case id.', productComponentId int NOT NULL COMMENT 'Associated test case id.', createdBy int NOT NULL COMMENT 'UserID who created this.', createDate datetime NOT NULL COMMENT 'Date when this step was created.', lastChangedBy int NOT NULL, lastChangeDate datetime NOT NULL, PRIMARY KEY (testCaseProductComponentId) ) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Components covered by test case - optional.';
DROP TABLE TestCaseStatus;
CREATE TABLE TestCaseStatus ( testCaseStatusId int NOT NULL AUTO_INCREMENT, PRIMARY KEY (testCaseStatusId) ) ENGINE=InnoDB DEFAULT CHARSET=utf8;
DROP TABLE TestCaseStatusLocale;
CREATE TABLE TestCaseStatusLocale ( testCaseStatusId int NOT NULL AUTO_INCREMENT, description varchar(50) NOT NULL, sortOrder int NOT NULL, localeCode varchar(10) DEFAULT 'en_US' NOT NULL, PRIMARY KEY (testCaseStatusId, localeCode) ) ENGINE=InnoDB DEFAULT CHARSET=utf8;
DROP TABLE TestCaseStep;
CREATE TABLE TestCaseStep ( testCaseStepId int NOT NULL AUTO_INCREMENT, testCaseVersionId int NOT NULL COMMENT 'Associated test case id.', stepNumber int NOT NULL COMMENT 'Execution step number.', name varchar(255) NOT NULL, instruction text NOT NULL COMMENT 'Descriptions of tasks required t execute this step.', expectedResult text NOT NULL COMMENT 'Description of the outcome.', estimatedTimeInMin int, createdBy int NOT NULL COMMENT 'UserID who created this.', createDate datetime NOT NULL COMMENT 'Date when this step was created.', lastChangedBy int NOT NULL, lastChangeDate datetime NOT NULL, version int DEFAULT '0' NOT NULL, PRIMARY KEY (testCaseStepId) ) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Contains instructions and results for each step.';
DROP TABLE TestCaseTag;
CREATE TABLE TestCaseTag ( testCaseTagId int NOT NULL AUTO_INCREMENT COMMENT 'Seq Num.', testCaseId int NOT NULL COMMENT 'Associated test case id.', tag varchar(45) NOT NULL COMMENT 'Short text associated with the test case.', createdBy int NOT NULL COMMENT 'UserID who created this.', createDate datetime NOT NULL, lastChangedBy int NOT NULL, lastChangeDate datetime NOT NULL, PRIMARY KEY (testCaseTagId) ) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Contains short tags associated with this Test Case. ';
DROP TABLE TestCaseVersion;
CREATE TABLE TestCaseVersion ( testCaseVersionId int NOT NULL AUTO_INCREMENT, testCaseId int NOT NULL, name varchar(255) NOT NULL, testCaseStatusId int NOT NULL COMMENT 'active, pending, etc.', description text NOT NULL, majorVersion int NOT NULL, minorVersion int NOT NULL, latestVersion tinyint(1) NOT NULL, approvalStatusId int NOT NULL COMMENT 'Pending/Approved/Rejected', approvedBy int COMMENT 'TM (or anyone with permission to Approve).', approveDate datetime, environmentProfileId int COMMENT 'Optional association to a set of Environments.', createdBy int NOT NULL, createDate datetime NOT NULL, lastChangedBy int NOT NULL, lastChangeDate datetime NOT NULL, version int NOT NULL, productId int NOT NULL, PRIMARY KEY (testCaseVersionId) ) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='Test Cases defined for a specific Product Version.';
DROP TABLE TestCycle;
CREATE TABLE TestCycle ( testCycleId int NOT NULL AUTO_INCREMENT, name varchar(255) NOT NULL, description text NOT NULL, productId int NOT NULL, testCycleStatusId int NOT NULL, environmentProfileId int NOT NULL, startDate datetime NOT NULL, endDate datetime COMMENT 'End date could be null to specify ongoing project.', communityAuthoringAllowed tinyint(1) NOT NULL, communityAccessAllowed tinyint(1) NOT NULL COMMENT 'If Testers can submit test cases.', createdBy int NOT NULL, createDate datetime NOT NULL, lastChangedBy int NOT NULL, lastChangeDate datetime NOT NULL, version int NOT NULL, PRIMARY KEY (testCycleId) ) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Controls User access to activities.';
DROP TABLE TestCycleUser;
CREATE TABLE TestCycleUser ( testCycleId int NOT NULL, userId int NOT NULL, PRIMARY KEY (testCycleId, userId) ) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Team of testers selected for project (Test Cycle).';
DROP TABLE TestCycleUserRole;
CREATE TABLE TestCycleUserRole ( testCycleId int NOT NULL, accessRoleId int NOT NULL, userId int NOT NULL, PRIMARY KEY (testCycleId, accessRoleId, userId) ) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Optional Roles assigned to project team members.';
DROP TABLE TestPlan;
CREATE TABLE TestPlan ( testPlanId int NOT NULL AUTO_INCREMENT, productId int NOT NULL, name varchar(255) NOT NULL, description text, testPlanStatusId int NOT NULL, environmentProfileId int, createdBy int NOT NULL, createDate datetime NOT NULL, lastChangedBy int NOT NULL, lastChangeDate datetime NOT NULL, version int NOT NULL, PRIMARY KEY (testPlanId) ) ENGINE=InnoDB DEFAULT CHARSET=utf8;
DROP TABLE TestPlanStatus;
CREATE TABLE TestPlanStatus ( testPlanStatusId int NOT NULL AUTO_INCREMENT, PRIMARY KEY (testPlanStatusId) ) ENGINE=InnoDB DEFAULT CHARSET=utf8;
DROP TABLE TestPlanStatusLocale;
CREATE TABLE TestPlanStatusLocale ( testPlanStatusId int NOT NULL AUTO_INCREMENT, description varchar(50) NOT NULL, sortOrder int NOT NULL, localeCode varchar(10) DEFAULT 'en_US' NOT NULL, PRIMARY KEY (testPlanStatusId, localeCode) ) ENGINE=InnoDB DEFAULT CHARSET=utf8;
DROP TABLE TestPlanTestSuite;
CREATE TABLE TestPlanTestSuite ( testPlanTestSuiteId int NOT NULL AUTO_INCREMENT, testSuiteId int NOT NULL, runOrder int NOT NULL, createdBy int NOT NULL, createDate datetime NOT NULL, lastChangedBy int NOT NULL, lastChangeDate datetime NOT NULL, testPlanId int NOT NULL, version int DEFAULT '0' NOT NULL, PRIMARY KEY (testPlanTestSuiteId) ) ENGINE=InnoDB DEFAULT CHARSET=utf8;
DROP TABLE TestRun;
CREATE TABLE TestRun ( testRunId int NOT NULL AUTO_INCREMENT, name varchar(255) NOT NULL, description text, testRunStatusId int NOT NULL, testCycleId int NOT NULL COMMENT 'TestCycleId for wich this Test Run was created.', productId int NOT NULL, startDate datetime, endDate datetime, useLatestVesrions tinyint(1) NOT NULL, selfAssignAllowed tinyint(1) NOT NULL, selfAssignLimit int DEFAULT '1' NOT NULL, selfAssignPerEnvironment tinyint(1) NOT NULL, environmentProfileId int, createdBy int NOT NULL, createDate datetime NOT NULL, lastChangedBy int NOT NULL, lastChangeDate datetime NOT NULL, version int NOT NULL, PRIMARY KEY (testRunId) ) ENGINE=InnoDB DEFAULT CHARSET=utf8;
DROP TABLE TestRunExternalBug;
CREATE TABLE TestRunExternalBug ( testRunExternalBugId int NOT NULL AUTO_INCREMENT COMMENT 'Sequential ID.', testRunResultId int NOT NULL, externalBugId varchar(45) NOT NULL COMMENT 'External Bug Tracking system bug id.', externalBugUrl varchar(255) COMMENT 'External Bug Tracking system bug URL.', createdBy int NOT NULL, createDate datetime NOT NULL, lastChangedBy int NOT NULL, lastChangeDate datetime NOT NULL, PRIMARY KEY (testRunExternalBugId) ) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Sexternal bug tracking system ids. ';
DROP TABLE TestRunResult;
CREATE TABLE TestRunResult ( testRunResultId int NOT NULL AUTO_INCREMENT, testRunAssignmentId int NOT NULL, testRunId int NOT NULL, productId int NOT NULL, testCaseId int NOT NULL, testCaseVersionId int NOT NULL, testerId int NOT NULL, testRunResultStatusId int NOT NULL COMMENT 'Status: NOT TESTED, BLOCKED, FAILED, PASSED', runDate datetime, actualResult text, failedStepNumber int, actualTimeInMin int, comment text, approvalStatusId int NOT NULL COMMENT 'Approved/Rejected', approvedBy int COMMENT 'TM (or anyone with permission to Approve).', approveDate datetime, environmentGroupId int, createdBy int NOT NULL, createDate datetime NOT NULL, lastChangedBy int NOT NULL, lastChangeDate datetime NOT NULL, version int NOT NULL, PRIMARY KEY (testRunResultId) ) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Results of Test Case within a Test Run. ';
DROP TABLE TestRunResultStatus;
CREATE TABLE TestRunResultStatus ( testRunResultStatusId int NOT NULL AUTO_INCREMENT, PRIMARY KEY (testRunResultStatusId) ) ENGINE=InnoDB DEFAULT CHARSET=utf8;
DROP TABLE TestRunResultStatusLocale;
CREATE TABLE TestRunResultStatusLocale ( testRunResultStatusId int NOT NULL AUTO_INCREMENT, description varchar(50) NOT NULL, sortOrder int NOT NULL, localeCode varchar(10) DEFAULT 'en_US' NOT NULL, PRIMARY KEY (testRunResultStatusId, localeCode) ) ENGINE=InnoDB DEFAULT CHARSET=utf8;
DROP TABLE TestRunStatus;
CREATE TABLE TestRunStatus ( testRunStatusId int NOT NULL AUTO_INCREMENT, PRIMARY KEY (testRunStatusId) ) ENGINE=InnoDB DEFAULT CHARSET=utf8;
DROP TABLE TestRunStatusLocale;
CREATE TABLE TestRunStatusLocale ( testRunStatusId int NOT NULL AUTO_INCREMENT, description varchar(50) NOT NULL, sortOrder int NOT NULL, localeCode varchar(10) DEFAULT 'en_US' NOT NULL, PRIMARY KEY (testRunStatusId, localeCode) ) ENGINE=InnoDB DEFAULT CHARSET=utf8;
DROP TABLE TestRunTestCase;
CREATE TABLE TestRunTestCase ( testRunTestCaseId int NOT NULL AUTO_INCREMENT, testRunId int NOT NULL, testCaseVersionId int NOT NULL, testCaseId int NOT NULL, priorityId int NOT NULL, runOrder int NOT NULL, blocking tinyint(1) NOT NULL, selfAssignAllowed tinyint(1) NOT NULL, selfAssignLimit int DEFAULT '1' NOT NULL, selfAssignPerEnvironment tinyint(1) NOT NULL, environmentProfileId int, testSuiteId int COMMENT 'Optional, if Test Case came from a Test Suite or null.', createdBy int NOT NULL, createDate datetime NOT NULL, lastChangedBy int NOT NULL, lastChangeDate datetime NOT NULL, version int DEFAULT '0' NOT NULL, PRIMARY KEY (testRunTestCaseId) ) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='TestCases assigned to a test run.';
DROP TABLE TestRunTestCaseAssignment;
CREATE TABLE TestRunTestCaseAssignment ( testRunAssignmentId int NOT NULL AUTO_INCREMENT, testRunTestCaseId int NOT NULL, productId int NOT NULL, testRunId int NOT NULL, testCaseId int NOT NULL, testCaseVersionId int NOT NULL, testerId int NOT NULL, environmentProfileId int, createdBy int NOT NULL, createDate datetime NOT NULL, lastChangedBy int NOT NULL, lastChangeDate datetime NOT NULL, version int DEFAULT '0' NOT NULL, PRIMARY KEY (testRunAssignmentId) ) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Testers assigned to run specific TestCases for a test run. ';
DROP TABLE TestSuite;
CREATE TABLE TestSuite ( testSuiteId int NOT NULL AUTO_INCREMENT, productId int NOT NULL, name varchar(255) NOT NULL, description text, testSuiteStatusId int NOT NULL, environmentProfileId int, useLatestVersions tinyint(1) NOT NULL, createdBy int NOT NULL, createDate datetime NOT NULL, lastChangedBy int NOT NULL, lastChangeDate datetime NOT NULL, version int NOT NULL, PRIMARY KEY (testSuiteId) ) ENGINE=InnoDB DEFAULT CHARSET=utf8;
DROP TABLE TestSuiteStatus;
CREATE TABLE TestSuiteStatus ( testSuiteStatusId int NOT NULL AUTO_INCREMENT, PRIMARY KEY (testSuiteStatusId) ) ENGINE=InnoDB DEFAULT CHARSET=utf8;
DROP TABLE TestSuiteStatusLocale;
CREATE TABLE TestSuiteStatusLocale ( testSuiteStatusId int NOT NULL AUTO_INCREMENT, description varchar(50) NOT NULL, sortOrder int NOT NULL, localeCode varchar(10) DEFAULT 'en_US' NOT NULL, PRIMARY KEY (testSuiteStatusId, localeCode) ) ENGINE=InnoDB DEFAULT CHARSET=utf8;
DROP TABLE TestSuiteTestCase;
CREATE TABLE TestSuiteTestCase ( testSuiteTestCaseId int NOT NULL AUTO_INCREMENT, testSuiteId int NOT NULL, testCaseVersionId int NOT NULL, testCaseId int NOT NULL, priorityId int NOT NULL, runOrder int NOT NULL, blocking tinyint(1) NOT NULL, environmentProfileId int, createdBy int NOT NULL, createDate datetime NOT NULL, lastChangedBy int NOT NULL, lastChangeDate datetime NOT NULL, version int DEFAULT '0' NOT NULL, PRIMARY KEY (testSuiteTestCaseId) ) ENGINE=InnoDB DEFAULT CHARSET=utf8;
DROP TABLE User;
CREATE TABLE User ( userId int NOT NULL AUTO_INCREMENT, password varchar(255) NOT NULL, firstName varchar(50) NOT NULL, lastName varchar(50) NOT NULL, email varchar(255) NOT NULL, code varchar(255) NOT NULL, confirmedEmail tinyint(1) NOT NULL, userStatusId int NOT NULL, createdBy int NOT NULL, createDate datetime NOT NULL, lastChangedBy int NOT NULL, lastChangeDate datetime NOT NULL, version int DEFAULT '0' NOT NULL, PRIMARY KEY (userId) ) ENGINE=InnoDB DEFAULT CHARSET=utf8;
DROP TABLE UserPreference;
CREATE TABLE UserPreference ( userId int NOT NULL, preferenceId int NOT NULL, PRIMARY KEY (userId, preferenceId) ) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Associates User and his preferences.';
DROP TABLE UserRole;
CREATE TABLE UserRole ( userRoleId int NOT NULL AUTO_INCREMENT, userId int NOT NULL, accessRoleId int NOT NULL, createdBy int NOT NULL, createDate datetime NOT NULL, lastChangedBy int NOT NULL, lastChangeDate datetime NOT NULL, PRIMARY KEY (userRoleId) ) ENGINE=InnoDB DEFAULT CHARSET=utf8;
